import React from "react";
import logo from "../asset/areocovert-logo.svg";

const Navbar = () => {
  return (
    <div className="bg-[#fff] flex justify-between h-[104px] items-center fixed top-0 left-0 w-full z-10 px-6 sm:px-10 md:px-16 lg:px-20 xl:px-24">
      <div className="">
        <img src={logo} alt="logo" />
      </div>
      <div className="hidden md:flex">
        <ul className="flex justify-between gap-[40px]">
          <li className="text-[#054B98] font-mont text-base font-semibold normal-case">
            Home
          </li>
          <li className="text-[#054B98] font-mont text-base font-semibold normal-case">
            About
          </li>
          <li className="text-[#054B98] font-mont text-base font-semibold normal-case">
            Service
          </li>
          <li className="text-[#054B98] font-mont text-base font-semibold normal-case">
            Contact
          </li>
        </ul>
      </div>
      <div className="flex gap-7">
        <button
          className="text-[#054B98] font-mont text-base font-semibold normal-case hidden md:block"
          onClick={() => {
            window.location.href = "/login";
          }}
        >
          Login
        </button>
        <button
          className="bg-[#FFB01D] font-mont text-[#000] px-4 py-2 rounded-full text-lg font-bold leading-normal capitalize w-[180px] h-[50px]"
          onClick={() => {
            window.location.href = "/register";
          }}
        >
          Sign Up
        </button>
      </div>
    </div>
  );
};

export default Navbar;
